    topText: "One does not simply",
    bottomText: "Walk into Mordor",
    imageUrl: "http://i.imgflip.com/1bij.jpg",
  });

  function handleChange(event) {
    event.preventDefault();
    console.log(event.currentTarget);
  }

  return (
    <div className="App">
      <Header />
      <Main />
    </div>
  );
}

export default App;
